import React from "react";
import { NavLink } from "react-router-dom";

const Navigation = () => {
   return (
      <div>
         <header className="App">
            <h1>BidScope.IO</h1>
            <div className="nav">
            <NavLink to="/">Home</NavLink>
            <NavLink to="/pdf">Pdf Parse</NavLink>
            </div>
         </header>
      </div>
   );
};

export default Navigation;
